import { View, Text, Button } from 'react-native'
import React from 'react'

const ChatList = () => {
  return (
    <View>
      <Text>Chat List</Text>
      <Button className={"btn border bg-cyan-100 text-center text-gray-700"} title="Go to Chat" />
    </View>
  )
}

export default ChatList
